@import url('./../../../blocks/cards.scss');
@import url('./../../../blocks/footer/footer.scss');
@import url('./../../../pages/room-details/room-details.scss');

$darkshade100:#1F2041;
$darkshade75:rgba(31, 32, 65, 0.75);
$darkshade50:rgba(31, 32, 65, 0.5);
