        url('./../../../assets/fonts/Montserrat/Montserrat-Bold.svg#Montserrat-Bold') format('svg');
    font-weight: bold;
    font-style: normal;
    font-display: swap;
}

.rate-button{

  &__header{
    margin-bottom: 16px;
  }
}

.stars-ratings-wrapper{
  display: flex;
}

.stars-ratings{
  display: flex;
  margin-right: 20px;

  &:last-child{
    margin-right: 0;
  }
}

.material-icons{
  font-family: 'Material Icons';
  font-style: normal;
  font-weight: 400;
  font-size: 24px;

  &-star{
    line-height: 20px;
    background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    background-clip: text;
    cursor: pointer;
  }

  &-expand{
    line-height: 24px;
    background: $darkshade50;
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    background-clip: text;
    cursor: pointer;
  }

  &-favorite{
    font-size: 10px;
    background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    background-clip: text;

    &-border{
      font-size: 10px;
      background: $darkshade25;
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
      background-clip: text;
    }
  }
}


.elements{
  position: relative;
  padding: 140px 0 131px 0;

  &__logo{
    position: absolute;
    top: 30px;
    left: 30px;
  }

  &-inner{
    
    &-1{
      display: flex;
      justify-content: space-between;
    }
    
    &-2,&-3{
      display: flex;
      justify-content: space-between;
    }
  }

  &__item{
    width: 100%;
    margin-bottom: 20px;

    &_header{
      width: 100%;
      display: flex;
      justify-content: space-between;
      margin-bottom: 5px;
    }

    &_state{
      font-family: 'Montserrat';
      font-style: normal;
      font-weight: 400;
      font-size: 12px;
      line-height: 15px;
      text-transform: uppercase;
      color: $darkshade50;
    }

    &-box{
      width: 150px;  
    }

    &_content{
      padding: 7px 7px 7px 15px;
      width: 100%;
      border-bottom-left-radius: 4px;
      border-bottom-right-radius: 4px;
      border: 1px solid rgba(31, 32, 65, 0.5);
      border-top: none;
    }
  }
}


.column{
  width: 320px;

  &-2{
    width: 711px;
  }

  &-3{
    width: 100%;
  }
}

.card{

  &__input{

    &-hover{
      background: #FFFFFF;
      border: 1px solid $darkshade50;

      &::placeholder{
        font-family: 'Montserrat';
        font-style: normal;
        font-weight: 400;
        font-size: 14px;
        line-height: 24px;
        color: $darkshade75;
      }
    }

    &-dropdown{
      border: none;
      width: 276px;
      height: 100%;
      font-family: 'Montserrat';
      font-style: normal;
      font-weight: 400;
      font-size: 14px;
      line-height: 24px;
      color: $darkshade75;
      cursor: pointer;
      display: flex;
      align-items: center;
    }

    &-wrapper{
      display: flex;
      align-items: center;
      background: #FFFFFF;
      border: 1px solid rgba(31, 32, 65, 0.25);
      box-sizing: border-box;
      border-radius: 4px;
      padding: 12px 15px;
      margin-bottom: 10px;
      height: 44px;
      cursor: pointer;

      &-expanded{
        margin-bottom: 0;
        border-bottom-right-radius: 0;
        border-bottom-left-radius: 0;
        border: 1px solid $darkshade50;
      }
    }

    &-dropdown{

      &-pre{

        &-default{
          width: 276px;
        }
      }
    }

    &-date{

      &-dropdown{
        width: 100%;
        height: 100%;
        border: none;
        font-family: 'Montserrat';
        font-style: normal;
        font-weight: 400;
        font-size: 14px;
        line-height: 18px;
        color: $darkshade75;
        cursor: pointer;
      }
    }
  }
}

.review{

  &__name{
    font-family: 'Montserrat';
    font-style: normal;
    font-weight: 700;
    font-size: 14px;
    line-height: 24px;
    color: rgba(31, 32, 65, 0.75);
  }

  &__date{
    font-family: 'Montserrat';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 24px;
    color: rgba(31, 32, 65, 0.75);
  }

  &__avatar{
    width: 48px;
    height: 48px;
    border: 2px solid #FFFFFF;
    box-sizing: border-box;
    filter: drop-shadow(0px 10px 20px rgba(31, 32, 65, 0.1));
    border-radius: 32px;

    &_image{
      width: 100%;
      height: 100%;
      border-radius: 100%;
    }
  }
}

.date-dropdown-wrapper{
  display: flex;
  justify-content: space-between;
  margin-bottom: 40px;
}

.masked-text-field{
  margin-bottom: 40px;
}

.filter-date-dropdown{
  width: 266px;
  margin-bottom: 40px;
}

.subscription-text-field{
  margin-bottom: 100px;
  width: 266px;
}


.dropdown-expanded,
.dropdown-default{
  width: 266px;
}

.dropdown-expanded{
  margin-bottom: 40px;
}

// .card__input-wrapper_expanded-shadow{
//   filter: drop-shadow(0px 10px 20px rgba(31, 32, 65, 0.05));
// }

.dropdown-list{

  &__item{
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 7px;

    &_name{
      font-family: 'Montserrat';
      font-style: normal;
      font-weight: 700;
      font-size: 12px;
      line-height: 15px;
      text-transform: uppercase;
      color: $darkshade100;
    }
