      font-style: normal;
      font-weight: 400;
      font-size: 18px;
      line-height: 22px;
      display: flex;
      align-items: center;
      justify-content: center;
      color: rgba(31, 32, 65, 0.5);
      cursor: pointer;
      border: 1px solid rgba(31, 32, 65, 0.25);
